import React from "react";
import { useEffect, useState, useContext } from "react";
import { useHistory } from "react-router-dom";
import Layout from "../components/Layout";

const Workspace = () => {
  const history = useHistory();
  const userName = localStorage.getItem("user_name");

  return (
    <Layout>
      <div className="mx-auto mt-5 md:w-4/5 font-mono">
        <h1 className="text-4xl font-bold text-primary-default">Workspace</h1>
        <ul className="flex">
        <li className=" ">
            <h3 className="title mt-8 mx-6">
              Hi, {userName} !
            </h3>
            <span>This is your workspace</span>
          </li>
          <li className=" mx-8 transform inline-flex transition duration-500 hover:scale-110">
            <img
              src={require("../assets/homescreen.png")}
              alt="home"
              className="hidden w-8/12 object-fit lg:block"
            />
          </li>
       
        </ul>
      </div>
    </Layout>
  );
};

export default Workspace;
